.first-screen header {
    margin-top: 25px;
}

.first-screen header .logo {
    width: 238px;
    display: flex;
    align-items: center;
}

.first-screen header .logo .logo-background {
    width: 46px;
    height: 46px;
    border-radius: 100%;
    background-color: var(--bg_fon);
}

.first-screen header .logo .logo-background img {
    display: flex;
    margin: 6px 5px 16px;
}
.first-screen header .logo span {
    font-weight: 400;
    font-size: 35px;
    margin-left: 10px;
    color: var(--color_text_1);
}

.first-screen header .navbar {
    display: flex;
    align-items: center;
    justify-content: space-between;
}

.first-screen header .navbar .nav-links .menu {
    width: 442px;
    display: flex;
    justify-content: space-between;
}

.first-screen header .navbar .nav-links .menu li {
    list-style: none;
}

.first-screen header .navbar .nav-links .menu a {
    text-decoration: none;
    font-weight: 400;
    font-size: 20px;
    letter-spacing: 0.02em;
    color: var(--color_text_1);
}

.first-screen header .btn-block, .btn-auth {
    display: flex;  
}

.btn-auth{
    margin: 0 20px;
}
.btn-auth button{
    margin: 0 10px;
    background-color: #3AAFA9;
    border-radius: 10px;
    border: none;
    color: var(--color_first);
    padding: 0 5px;
    font-weight: bold;
    cursor: pointer;
}

.first-screen header .btn-search, .btn-cart  {
    width: 28px;
    height: 28px;
    border-radius: 100%;
    background-color: var(--bg_fon);
}

.first-screen header .btn-search, img {
    padding-left: 3px;
    padding-top: 3px;
}

.first-screen header .btn-cart img {
    padding-left: 5px;
    padding-top: 5px;
}

.first-screen header .btn-search .btn:first-child {
    margin-left: 94px;
}

.first-screen header .btn-search .btn .btn-box {
    width: 94px;
    display: flex;
}

.first-screen header .btn-search .btn .btn-box span {
    width: 54px;
    font-weight: 400;
    font-size: 18px;
    margin-left: 8px;
}

.first-screen header .btn  {
    width: 32px;
    height: 32px;
    border-radius: 100%;
    background-color: var(--bg_fon);
}

.first-screen header .btn img {
    display: flex;
    margin: 8px;
}

#checkbox_toogle {
    display: none;
}

.hamburger {
    display: none;
    font-size: 24px;
    cursor: pointer;
}

.hamburger-line {
    background-color: var(--bg_fon);
    display: block;
    height: 2px;
    position: relative;
    width: 24px;
}

.hamburger-line::before, .hamburger-line::after {
    background-color: var(--bg_fon);
    content: '';
    display: block;
    position: absolute;
    transition: all 0.3s;
    width: 100%;
    height: 100%;
}

.hamburger-line::before {
    top: 7px;
}

.hamburger-line::after {
    top: -7px;
}

.first-screen main {
    width: 1070px;
    height: 505px; 
    background-color: var(--bg_fon);
    position: relative;
    border-radius: 25px;
    margin: 75px 15px 211px 100px; 
}

.first-screen main article {
    display: flex;
}

.first-screen main article .box-color h1 {
    width: 413px;  
    font-weight: 400;
    font-size: 60px;
    line-height: 80px;
    margin: 56px 355px 8px 302px;
    color: var(--color_text_1);
}

.first-screen main .border {
    width: 95px;
    border: 1px solid #000000;
    margin: 0px 673px 16px 302px;
}

.first-screen main article .text p {
    width: 469px;
    font-weight: 400;
    font-size: 16px;
    margin: 0 299px 16px 302px;
    color: var(--color_text_1);
}

.first-screen main article .text-with-border p a {
    width: 74px;
    height: 27px;
    font-weight: 600;
    font-size: 16px;
    text-decoration: none;
    border-bottom: 1px solid #333333;
    margin: 0 694px 41px 302px;
    color: var(--color_text_1);    
}

.first-screen main article .btn-sale {
    display: flex;
    margin-top: 41px;
    margin-bottom: 65px;
}

.first-screen main article .btn-sale .btn-first a {
    width: 229px;
    display: flex;
    align-items: center;
    background-color: #DEF2F1;
    border-radius: 10px;
    padding: 14px 39px;
    text-decoration: none;
    margin: 0 73px 65px 399px;
}

.first-screen main article .btn-sale .btn-first a .color-circle {
    width: 28px;
    height: 28px;
    background-color: var(--bg_fon);
    border-radius: 100%;
}
.first-screen main article .btn-sale .btn-first a .color-circle img {
    width: 19px;
    height: 12px;  
    margin: 8px 4.5px 7.3px 4px;
}

.first-screen main article .btn-sale .btn-first a p {
    width: 108px;
    font-weight: 400;
    font-size: 20px;
    color: var(--color_text_2);
    margin-left: 15px;
}

.first-screen main article .btn-sale .btn-second a {
    width: 139px;
    display: flex;
    align-items: center;
    background-color: #DEF2F1;
    border-radius: 10px;
    padding: 14px 31px;
    text-decoration: none;
    margin: 0 230px 65px 0;
}

.first-screen main article .btn-sale .btn-second a img {
    width: 20px;
    height: 20px;
    margin-top: 5px;    
}

.first-screen main article .btn-sale .btn-second a p {
    width: 37px;
    font-weight: 400;
    font-size: 20px;
    color: var(--color_text_2);
    margin-left: 15px;
}

.first-screen main article .box-color .btn-arrow {
    width: 60px; 
}

.first-screen main article .box-color .btn-arrow a img {
    padding: 19px 24px 18px 24.5px;
    background-color: #cdeceb;
    border-radius: 10px;
}

.first-screen main article .box-color .btn-arrow:nth-child(2) a img {
    padding: 19px 24.5px 18px 24px;
}

.first-screen main article .box-color .btn-arrow:first-child {
    position: absolute;    
    bottom: -40px;
    right: 110px; 
}

.first-screen main article .box-color .btn-arrow:nth-child(2) {
    position: absolute;
    bottom: -40px;
    right: 35px;
}

.first-screen main article .box-color .image-card {
    position: absolute;
    top: 56px;
    right: 854px;
}

