}

.third-screen .info-cards {
    display: flex;
    justify-content: space-between;
    margin-top: 120px;
}

.third-screen .info-cards .card {
    width: 271px;
    background-color: var(--bg_fon);
    border-radius: 15px;
    position: relative;
}

.third-screen .info-cards .card .image-card {
    position: absolute;
    top: -40px;
    left: 30px;
}

.third-screen .info-cards .card .info {
    width: 146px;    
    margin: 213px 101px 17px 24px;
}

.third-screen .info-cards .card .info h3 {
    width: 167px;
