    font-size: 24px;
    margin-bottom: 5px;    
    color: var(--color_text_1);
}

.third-screen .info-cards .card .info span {
    width: 62px;
    font-weight: 400;
    font-size: 16px;
    margin-bottom: 5px;    
    color: var(--color_text_3);    
}

.third-screen .info-cards .card .info .line-through span {
    width: 98px;
    font-weight: 400;
    font-size: 16px;
    margin-bottom: 5px;
    color: var(--color_text_3);
    text-decoration: line-through #D93F3F;
}

.third-screen .info-cards .card .info p {
    width: 146px;
    font-weight: 400;
    font-size: 24px;
    color: var(--color_text_1);
}

.third-screen .info-cards .card .hidden-btn {
    width: 205px;
    margin: 17px 37px 16px 26px;
    display: flex;
    align-items: center;
    opacity: 0;
    transition: opacity .35s ease;    
}

.third-screen .info-cards .card:hover .hidden-btn {
    opacity: 1;   
}

.third-screen .info-cards .card .hidden-btn .square-btn {
    width: 39px;
    height: 39px;
    background-color: #DEF2F1;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
}

.third-screen .info-cards .card .hidden-btn .square-btn .circle {
    width: 24px;
    height: 24px;
    background-color: var(--bg_fon);
    border-radius: 100%;
} 

.third-screen .info-cards .card .hidden-btn .square-btn img {
    width: 19px;
    height: 12px;
    margin: 2px;  
}

.third-screen .info-cards .card .hidden-btn .rectangle-btn {
    width: 158px;
    height: 39px;
    background: #DEF2F1;
    border-radius: 10px;
    margin-left: 8px;
}

.third-screen .info-cards .card .hidden-btn .rectangle-btn a {
    width: 86px;
    font-weight: 400;
    font-size: 16px;
    margin: 8px 36px 7px;
    color: var(--color_text_2);
    text-decoration: none;
    display: flex;
}

.fourth-screen  {
    margin-top: 80px;
}

.fourth-screen h2 {
