    letter-spacing: 0.02em;
}

.fifth-screen .product-list .box:nth-child(2) h3 {
    width: 230px;
    text-align: center;
}

.fifth-screen .product-list .box:nth-child(2) .our-products .flex .info p:nth-child(2) {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
